import Button from "../components/Button";
import Header from "../components/Header";
import Navigator from "../components/Navigator";

const MyPage = () => {
    return(
        <div>
            <Header
                title="my page"
            />
            <Navigator/>
            <Button text={"회원정보 수정"}/>
            <Button text={"테스트 다시하기"}/>
            <Button text={"로그아웃"}/>
            <Button text={"회원탕퇴"}/>
        </div>
    )
}

export default MyPage;
